import React, { useState } from 'react';
import axios from 'axios';

export const Survey = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [reason, setReason] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    const dataToSubmit = {
      name,
      email,
      reason,
    };

    axios.post('https://your-api-url.com', dataToSubmit)
      .then((res) => console.log(res))
      .catch((err) => console.error(err));
  };

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-200">
      <form className="p-6 bg-white rounded shadow-md" onSubmit={handleSubmit}>
      xquare 서버에 자신이 개발한 프로젝트를 배포할 수 있게 하기 위한
        <label className="block mb-2 text-sm font-bold text-gray-700">
          이름
          <input
            className="w-full px-3 py-2 mt-1 text-sm leading-tight text-gray-700 border rounded shadow appearance-none focus:outline-none focus:shadow-outline"
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
          />
        </label>
        <label className="block mb-2 text-sm font-bold text-gray-700">
          이메일
          <input
            className="w-full px-3 py-2 mt-1 text-sm leading-tight text-gray-700 border rounded shadow appearance-none focus:outline-none focus:shadow-outline"
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
        </label>
        <label className="block mb-2 text-sm font-bold text-gray-700">
          지원동기
          <textarea
            className="w-full px-3 py-2 mt-1 text-sm leading-tight text-gray-700 border rounded shadow appearance-none focus:outline-none focus:shadow-outline"
            value={reason}
            onChange={(e) => setReason(e.target.value)}
          />
        </label>
        <button
          className="w-full px-4 py-2 mt-6 font-bold text-white bg-blue-500 rounded-md hover:bg-blue-700 focus:outline-none focus:shadow-outline"
          type="submit"
        >
          제출하기
        </button>
      </form>
    </div>
  );
}
